INSERT INTO `animes` (`id_animes`, `nome`, `episodios`, `lancamento`, `duracao`, `sinopse`, `imagem`, `id_fonte`, `id_tipo`, `id_estado`, `id_temporada`, `id_classificacao`, `nota_media`, `total_utilizadores`, `top_anime`) VALUES
(1, 'Gintama', 201, '4 de Abr, 2006 até 25 de Mar, 2010', '24 min. por episódio', 'Em uma terra dominada por alienígenas onde os samurais são inúteis, Sakata Gintoki (um ex-samurai), faz qualquer coisa por dinheiro. Junto com Shimura Shinpachi, um garoto que almeja ser um samurai, e Kagura, membro do clã mais poderoso do universo, entram em grandes encrencas, aceitam qualquer trabalho para fazer do mundo melhor… e para pagar o aluguel. Gintama faz paródias de vários animes que tiveram seu mangá publicado na revista japonesa Shounen Jump. Reúne os mais diversos tipos de géneros de anime mas sempre para o lado da comédia.', , 1, 1, 1, 1, 1, 8, 1, 26.666666666399998);
INSERT INTO `animes` (`id_animes`, `nome`, `episodios`, `lancamento`, `duracao`, `sinopse`, `imagem`, `id_fonte`, `id_tipo`, `id_estado`, `id_temporada`, `id_classificacao`, `nota_media`, `total_utilizadores`, `top_anime`) VALUES
(2, 'Naruto', 219, '3 de Out, 2002 até 8 de Fev, 2008', '24 min. por episódio', 'Naruto é uma criança que vive em Konoha, a vila ninja do País do Fogo. Quando ainda bebé, Naruto teve um youkai, que na crença japonesa representa um monstro, aprisionado em seu corpo, o Bijuu chamado Kyuubi, pelo Yondaime Hokage, para salvar a Aldeia da folha. Desde então, Naruto é visto por muitas pessoas como um monstro, não só pelos familiares das pessoas mortas pela Kyuubi, mas também por pessoas que sofrem com as besteiras feitas por ele, que é extremamente arteiro. Incompreendido, Naruto sonha em se tornar um ninja poderoso, e ser nomeado Hokage, para assim poder ser reconhecido por todos.', , 1, 2, 3, 2, 1, 5.5, 2, 36.6666666663);
INSERT INTO `animes` (`id_animes`, `nome`, `episodios`, `lancamento`, `duracao`, `sinopse`, `imagem`, `id_fonte`, `id_tipo`, `id_estado`, `id_temporada`, `id_classificacao`, `nota_media`, `total_utilizadores`, `top_anime`) VALUES
(3, 'Bleach', 366, ' 5 de Out, 2004 até 27 de Mar, 2012', '24 min. por episódio', 'Ichigo Kurosaki é um garoto de 15 anos que tem uma estranha capacidade de ver, tocar e falar com espíritos de pessoas mortas. Logo que a shinigami Rukia Kuchiki toma conhecimento dos poderes de Ichigo, vai atrás dele para investigar, e acaba em uma luta com um Hollow que foi atraído pelo forte poder espiritual de Ichigo. Antes de ser derrotada pela criatura, Rukia passa seus poderes a Ichigo, o qual se torna um shinigami, e após derrotar o Hollow ingressa em uma jornada para proteger os humanos e os espíritos da ameaça dos Hollows.', , 1, 1, 3, 3, 1, 0, 0, 0);

