--
-- Extraindo dados da tabela `personagens`
--

INSERT INTO `personagens` (`id_personagens`, `nome`, `biografia`, `imagem`) VALUES
(1, 'Gintoki Sakata', 'Gintoki Sakata é o fundador e presidente do Yorozuya, um samurai altamente qualificado e o protagonista da série Gintama.\r\nPossui diversos apelidos como: Gin-chan ou Gin-san. Quando está vestido de mulher, é conhecido como Paako. Sakamoto Tatsuma persiste em chama-lo de Kintoki. que passa a ser o seu nome em Kintama. Otose geralmente refere-se à ele como Permanente natural. ', );
INSERT INTO `personagens` (`id_personagens`, `nome`, `biografia`, `imagem`) VALUES
(2, 'Kagura', 'Kagura é um membro do Yorozuya e a protagonista de Gintama. Ela é uma jovem Amanto do clã Yato, conhecido e temido por toda a galáxia por sua força monstruosa e sede de sangue.', );
INSERT INTO `personagens` (`id_personagens`, `nome`, `biografia`, `imagem`) VALUES
(3, 'Elizabeth', 'Elizabeth é o estranho Amanto mascote de Katsura Kotarou e membro do Jouishishi. Está sempre ao lado de Katsura e se tornou o ajudante indispensável de Katsura . Ferozmente leal a Katsura , que o salvou em varias ocasiões. Quando Katsura desapareceu no inicio do arco Benizakura, Elizabeth foi ao encontro dos Yorozuya para pedir ajuda. No episódio 232, foi descoberto que Elizabeth era um(a) espião(a) da raça Renho.<br>\r\nUm elemento da serie foi que muitas vezes se deu a entender que Elizabeth era na verdade um homem numa fantasia e não um amanto real. No anime, esse homem era muito parecido com Takamatsu Shinji, o diretor do animie Gintama. No mangá, é revelado que o verdadeiro nome de Elizabeth é General Jiang-Lian da raça Lian-Feng. Uma raça especializada em operações secretas, e ele, juntamente com outros Lian-Feng, agem como mascotes de terraqueos a fim de preparar a Terra para uma invasão. ', );

